script: |
  super -f text -I q9951.spq | sort > q9951.out

inputs:
  - name: q9951.spq
    data: |
      SELECT + MAX ( col1 ) col0 FROM tab1 (FORMAT parquet) WHERE NOT ( + col1 * - col1 * 27 + - col1 ) BETWEEN + col1 AND 57 * - col1;
  - name: tab1

outputs:
  - name: q9951.out
    data: |
      47
